import axios from "axios";
import { useRef, useState } from "react";
import { DateRange } from "react-date-range";
import { useLocation, useNavigate } from "react-router-dom";
import Navbar from "../../components/navbar/Navbar";
import "./booking.css";
import Header from "../../components/header/Header";
const Booking = () => {
  const [date, setDate] = useState([
    {
      startDate: new Date(),
      endDate: new Date(),
      key: "selection",
    },
  ]);
  const [isDate, setIsDate] = useState(false);
  const [information, setInformation] = useState();
  const [isReserve, setIsReserve] = useState(false);
  const location = useLocation();
  const usenavigate = useNavigate();
  const fullname = useRef();
  const email = useRef();
  const phonenumber = useRef();
  const cardnumber = useRef();
  const handleSubmit = (e) => {
    e.preventDefault();
    setInformation({
      fullname: fullname.current.value,
      email: email.current.value,
      phonenumber: phonenumber.current.value,
      cardnumber: cardnumber.current.value,
      date: date,
    });
  };
  console.log(date)
  const dispatchInformation = () => {
    if (
      information.email &&
      information.phonenumber &&
      information.fullname &&
      information.cardnumber &&
      information.date
    ) {
      axios
        .post("http://localhost:5000/hotels/transaction", { data: information })
        .then((result) => {
          usenavigate("/");
        })
        .catch((err) => {
          console.log(err);
        });
    } else {
      alert("Can nhap day du thong tin!");
    }
  };
  return (
    <div >
      <Navbar></Navbar>
      <Header type={"list"} />
      <div className="information">
        <div className="info1">
          <h3>{location.state.name}</h3>
          <p>{location.state.desc}</p>
        </div>
        <div className="info2">
          <p>
            <b>${location.state.price}</b> (1 nights)
          </p>
          <button onClick={() => setIsReserve(!isReserve)}>
            Reserve orBooks Now!
          </button>
        </div>
      </div>

      {isReserve && (
        <div className="transaction">
          <div className="tran1">
            <h2>Dates</h2>
            <DateRange
              
              editableDateInputs={true}
              onChange={(item) => 
                {setDate([item.selection])
                  setIsDate(true)
                }}
              moveRangeOnFirstSelection={false}
              ranges={date}
              minDate={new Date()}
            ></DateRange>
          </div>
          {isDate && (
            <div className="tran2">
              <form onChange={handleSubmit}>
                <h2>Reserve Info</h2>
                <label>Your Full Name:</label>
                <input
                  ref={fullname}
                  type="text"
                  placeholder="Full Name"
                ></input>
                <label>Your Email:</label>
                <input ref={email} type="email" placeholder="Email"></input>
                <label>Your Phone Number:</label>
                <input
                  ref={phonenumber}
                  type="text"
                  placeholder="Phone Number"
                ></input>
                <label>Your Identity Card Number:</label>
                <input
                  ref={cardnumber}
                  type="text"
                  placeholder="Card Number"
                ></input>
              </form>
            </div>
          )}
        </div>
      )}
      {isDate && (
        <div className="transaction">
          <div>
            <h1>Select rooms</h1>
            <div>
              <h6>Budget Double Room</h6>
            </div>
            <div></div>
          </div>
          <div>
            <button onClick={dispatchInformation}>Reserve Now</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default Booking;
